import React from "react";
import Grid from "@material-ui/core/Grid"
import "./style.css"
import Project from "../Components/Projects/index";
import { withStyles } from "@material-ui/core";

const styles = {
    main_body: {
        marginLeft: "10%",
        marginRight: "10%",
    },
    intro: {
        marginTop: "50px",
        marginBottom: "10px",
        backgroundColor: "lightblue"
    },

    personal_container : {
        marginTop: "50px",
        padding: "",
        border: "2px black solid",
        backgroundColor: "lightgray"

    },

    contact_container : {
        marginTop: "50px",
        border: "2px black solid",
        backgroundColor: "lightgray"

    }
}


const Home = ({classes})=>{

        return (
        <div className = {classes.main_body}>
        <Grid container spacing = {24}>
            <Grid item xs={12} className={classes.intro}>
                    <h1>My name is Daniel</h1>
                    <p>Aspiring software engineer with a background in mechanical engineering and minor in computer science. Proficient in programming languages such as Python, Javascript, SQL. and other Web based technologies. I am always hungry to learn and develop my skills as I am on the tech career path.</p>
            </Grid>
            <Project/>          
            <Grid item xs={12} className={classes.personal_container}>
                <h1>About Me</h1>
                <p > Aspiring software engineer with a background in mechanical engineering and minor in computer science. Proficient in programming languages such as Python, Javascript, SQL. and other Web based technologies. I am always hungry to learn and develop my skills as I am on the tech career path.</p>
            </Grid>

            <Grid item xs={12} className={classes.contact_container}>
                <h1>Contact Info</h1>
                <ul>
                    <li><i class="fab fa-github"></i></li>
                    <li><i class="fab fa-github"></i></li>
                </ul>
            </Grid>
        </Grid>

        </div>
        )

    }


export default withStyles(styles)(Home);
